const NavbarLink = ({ children, ...props }) => (
  <Link px={5} {...props}>
    {children}
  </Link>
);

const Navbar = () => (
  <Flex alignItems="center" justifyContent="space-between" px={5} py={4}>
    <Flex flexDirection="row" justifyContent="center" alignItems>
      <Link as={NextLink} to="/">
        Jobaho
      </Link>
    </Flex>
    <Box>
      <NextLink href="/" passHref>
        <NavbarLink>Home</NavbarLink>
      </NextLink>
      <NextLink href="/about" passHref>
        <NavbarLink>About us</NavbarLink>
      </NextLink>
      <NextLink href="/jobSection" passHref>
        <NavbarLink>Find a Job</NavbarLink>
      </NextLink>
    </Box>
  </Flex>
);

export default Navbar;
